import {useState} from 'react'
import MovieItem from './MovieItem';

import movies from '../movies.json'

function MovieList() {

    return(
        <div className="movie-list">
            {
                movies.map(item => (
                    <MovieItem data={item} />
                ))
            }
        </div>
    )
}

export default MovieList;
